import { useState } from "react";

function Login() {
  const [checked, setCheked] = useState(false);
  let check = () => {
    setCheked(!checked);
  };

  return (
    <div>
      <input type="email" placeholder="Email" />
      <input type="password" />
      <label htmlFor="checkBox">Agree to our terms</label>
      <input type="checkBox" name="checkBox" onClick={() => check} />
      {!checked && <p id="notCheked">You must agree to our terms.</p>}
    </div>
  );
}

export default Login;
